import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ userName, onLogout }) => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        {userName ? (
          <>
            <li>Welcome, {userName}!</li>
            <li>
              <button onClick={onLogout} style={{ cursor: 'pointer' }}>
                Logout
              </button>
            </li>
          </>
        ) : (
          <li>
            <Link to="/login">Login</Link>
          </li>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
